import React from 'react';
import Carousello from './Carousel';
import Card from './Carta'

function HomePage(){
    return(
        <div className="HomePage">
            <div>
                <Carousello/>
            </div>
            <br/>
            <div className="row justify-content-md-center">
                <div class="col-md-4">
                    <Card/>
                </div>
            </div>
        </div>
    );
}

export default HomePage;
